import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Head from 'next/head';
import CssBaseline from '@material-ui/core/CssBaseline';
import Header from '../components/Header';
import GallerySmall from '../components/Gallery/GallerySmall';
import Counter from '../components/Counter';
import Notification from '../components/Notification';
import brand from '../public/text/brand';
import { withTranslation } from '../i18n';
import Refugee from '../components/Projectsux/Refugee.js';
import signin from '../public/images/profile/ref_signin.svg';
import { grey } from '@material-ui/core/colors';

const sectionMargin = margin => (margin * 10);
const useStyles = makeStyles(theme => ({
  mainWrap: {
    position: 'relative',
    width: '100%',
    overflow: 'hidden',
    background: theme.palette.type === 'dark' ? theme.palette.background.default : theme.palette.background.paper,
  },
  spaceBottom: {
    marginBottom: sectionMargin(theme.spacing())
  },
  spaceTop: {
    paddingTop: sectionMargin(theme.spacing())
  },
  containerWrap: {
    marginTop: theme.spacing(10),
    padding: theme.spacing(4),
    '& > section': {
      position: 'relative'
    },
    parallaxWrap: {
        position: 'relative'
      },
      projecktImage: {
          backgroundColor: '#efefef',
          position: 'relative',
          width: '100%',
          overflow: 'hidden',
        // paddingTop: theme.spacing(10),
        // padding: 40,
        // marginTop: 35,
        // width: '100%',
        // backgroundImage: `linear-gradient(120deg, ${theme.palette.type === 'dark' ? theme.palette.secondary.dark : theme.palette.secondary.main}, ${theme.palette.type === 'dark' ? theme.palette.primary.dark : theme.palette.primary.main})`,
      },
      counterWrap: {
        backgroundImage: `linear-gradient(120deg, ${theme.palette.type === 'dark' ? theme.palette.secondary.dark : theme.palette.secondary.main}, ${theme.palette.type === 'dark' ? theme.palette.primary.dark : theme.palette.primary.main})`,
        padding: theme.spacing(10, 0)
      },
  },
}));

function RefKitchen(props) {
  const classes = useStyles();
  const { onToggleDark, onToggleDir, t } = props;
  return (
    <React.Fragment>
      <Head>
        <title>
          { brand.profile.name }
          &nbsp; - Blank page
        </title>
      </Head>
      <CssBaseline />
      <div className={classes.mainWrap}>
        <Header
          onToggleDark={onToggleDark}
          onToggleDir={onToggleDir}
          invert
        />
        <main className={classes.containerWrap}>
          <section className={clsx(classes.spaceTop, classes.spaceBottom)}>
            <Typography variant="h2" align="center" gutterBottom>
             Refugee Kitchen
            </Typography>
            <Typography variant="h4" align="center">
             Design brief from briefbox.me
            </Typography>

          </section>
          <Refugee/> 

        </main>
       <section>
          <div className={classes.projecktImage}>
           <img src={signin} align="center" width="20%" alt="App on mobile" />
        </div>  
        </section>
        <div className={classes.counterWrap}>
      <Container maxWidth="md">
        <Grid container justify="center" alignItems="center" className={classes.root} spacing={6}>
          <Grid md={4} item>
            <ReactWOW animation="fadeIn" offset={300} callback={handlePlay}>
              <div className={classes.counterItem}>
                <div className={classes.text}>
                  <i className="ion-ios-briefcase-outline" />
                  <Typography variant="h4" className={text.title2}>
                    {countup(38, play)}
                  </Typography>
                </div>
                <Typography variant="h6" className={text.subtitle2}>
                  {t('common:profile-landing.counter_completed')}
                </Typography>
              </div>
            </ReactWOW>
          </Grid>
          {/* <Grid md={4} item>
            <div className={classes.counterItem}>
              <div className={classes.text}>
                <i className="ion-ios-time-outline" />
                <Typography variant="h4" className={text.title2}>
                  {countup(4567, play)}
                </Typography>
              </div>
              <Typography variant="h6" className={text.subtitle2}>
                {t('common:profile-landing.counter_hour')}
              </Typography>
            </div>
          </Grid> */}
          <Grid md={4} item>
            <div className={classes.counterItem}>
              <div className={classes.text}>
                <i className="ion-ios-heart-outline" />
                <Typography variant="h4" className={text.title2}>
                  {countup(28, play)}
                </Typography>
              </div>
              <Typography variant="h6" className={text.subtitle2}>
                {t('common:profile-landing.counter_happy')}
              </Typography>
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
        <GallerySmall/>

        {/* <Notification /> */}
      </div>
    </React.Fragment>
  );
}

RefKitchen.propTypes = {
  onToggleDark: PropTypes.func.isRequired,
  onToggleDir: PropTypes.func.isRequired,
  t: PropTypes.func.isRequired,
};

RefKitchen.getInitialProps = async () => ({
  namespacesRequired: ['common'],
});

export default withTranslation('common')(RefKitchen);
